import React from 'react';
import Container from '@mui/material/Container';

export default function Home() {
  return (
    <Container maxWidth='xl'>
    <div className='home'>
      <div className='header'>
        <div class='head-image'></div>
      </div>
    </div>
    </Container>
  )
}
